var directions = [
  [''],
  [''],
  [''],
  [''],
  ['']
];

// var keypad = [
//   [1, 2, 3],
//   [4, 5, 6],
//   [7, 8, 9]
// ];

var keypad = [
  [0, 0, '1', 0, 0],
  [0, '2', '3', '4', 0],
  ['5', '6', '7', '8', '9'],
  [0, 'A', 'B', 'C', 0],
  [0, 0, 'D', 0, 0]
]

var x = -2;
var y = 0;

var splitDirections = directions.map(function(element, index, array) {
  return array[index][0].split('');
});

function findKeys(directionsArray) {
  var result = '';
  directionsArray.forEach(function(element) {
    result += traverseDirections(element, x, y);
  })
  return result;
}

function traverseDirections(directionElement, x, y) {
  directionElement.forEach(function(element) {
    switch (element) {
      case 'U':
        if (y !== -2 && typeof keypad[y + 1][x + 2] === 'string') {
          y--
        }
        break;
      case 'D':
        if (y !== 2 && typeof keypad[y + 3][x + 2] === 'string') {
          y++
        }
        break;
      case 'L':
        if (x !== -2 && typeof keypad[y + 2][x + 1] === 'string') {
          x--
        }
        break;
      case 'R':
        if (x !== 2 && typeof keypad[y + 2][x + 3] === 'string') {
          x++
        }
        break;
    }
  });
  return keypad[y + 2][x + 2];
}

console.log(findKeys(splitDirections));